import React, { useEffect, useState } from "react";
import TopSongsHeader from "./TopSongsHeader";
import eth from "../../../src/assets/Icons/eth.png";
import { Sparklines, SparklinesLine } from "react-sparklines";

import "rsuite/dist/rsuite.min.css";
import Select from "react-select";
import DropdownsandSearchHeader from "./DropdownsandSearchHeader";
import { Link } from "react-router-dom";
import { Card, Col, ProgressBar, Table, Badge } from "react-bootstrap";

export default function Songs() {
  const sampleData = [8, 3, 8, 6, 5, 3, 5, 7, 5];
  const data = [
    {
      value: 1,
      text: "MUD",
      icon: (
        <svg
          xmlns="http://www.w3.org/2000/svg"
          width="16"
          height="16"
          fill="currentColor"
          class="bi bi-arrow-up-circle"
          viewBox="0 0 16 16">
          <path
            fill-rule="evenodd"
            d="M1 8a7 7 0 1 0 14 0A7 7 0 0 0 1 8zm15 0A8 8 0 1 1 0 8a8 8 0 0 1 16 0zm-7.5 3.5a.5.5 0 0 1-1 0V5.707L5.354 7.854a.5.5 0 1 1-.708-.708l3-3a.5.5 0 0 1 .708 0l3 3a.5.5 0 0 1-.708.708L8.5 5.707V11.5z"
          />
        </svg>
      ),
    },
    {
      value: 2,
      text: "BTX",
      icon: (
        <svg
          xmlns="http://www.w3.org/2000/svg"
          width="16"
          height="16"
          fill="currentColor"
          class="bi bi-arrow-down-circle"
          viewBox="0 0 16 16">
          <path
            fill-rule="evenodd"
            d="M1 8a7 7 0 1 0 14 0A7 7 0 0 0 1 8zm15 0A8 8 0 1 1 0 8a8 8 0 0 1 16 0zM8.5 4.5a.5.5 0 0 0-1 0v5.793L5.354 8.146a.5.5 0 1 0-.708.708l3 3a.5.5 0 0 0 .708 0l3-3a.5.5 0 0 0-.708-.708L8.5 10.293V4.5z"
          />
        </svg>
      ),
    },
    {
      value: 3,
      text: "BXG",
      icon: (
        <svg
          xmlns="http://www.w3.org/2000/svg"
          width="16"
          height="16"
          fill="currentColor"
          class="bi bi-arrow-left-circle"
          viewBox="0 0 16 16">
          <path
            fill-rule="evenodd"
            d="M1 8a7 7 0 1 0 14 0A7 7 0 0 0 1 8zm15 0A8 8 0 1 1 0 8a8 8 0 0 1 16 0zm-4.5-.5a.5.5 0 0 1 0 1H5.707l2.147 2.146a.5.5 0 0 1-.708.708l-3-3a.5.5 0 0 1 0-.708l3-3a.5.5 0 1 1 .708.708L5.707 7.5H11.5z"
          />
        </svg>
      ),
    },
    {
      value: 4,
      text: "ETH",
      icon: (
        <img
          src={eth}
          alt="eth"
          style={{
            width: "20px",
            height: "20px",
            borderRadius: "50%",
            background: "white",
          }}
        />
      ),
    },
  ];

  const data2 = [
    {
      value: 1,
      text: "1D",
    },
    {
      value: 2,
      text: "1W",
    },
    {
      value: 3,
      text: "1M",
    },
    {
      value: 4,
      text: "1Y",
    },
    {
      value: 5,
      text: "ALL",
    },
  ];

  const overviewData = [
    { id: 1, title: "ETH/USD", stroke: "#FD5353" },
    { id: 2, title: "BTC/USD", stroke: "#3AB67A" },
    { id: 3, title: "LTC/USD", stroke: "#FD5353" },
    { id: 4, title: "XRP/USD", stroke: "#FD5353" },
    { id: 5, title: "LTC/USD", stroke: "#3AB67A" },
    { id: 6, title: "XRP/USD", stroke: "#FD5353" },
  ];

  const [selectedOption, setSelectedOption] = useState(data[3]);
  const [selectedOptionforTime, setSelectedOptionforTime] = useState(data2[4]);

  useEffect(() => {
    console.log("selectedOption", selectedOption);
  }, [selectedOption]);

  useEffect(() => {
    console.log("selectedOptionfortime", selectedOptionforTime);
  }, [selectedOptionforTime]);

  return (
    <div
      className="col-12 col-sm-8  col-md-8 col-lg-8"
      style={{
        background: "rgba(5, 24, 57, 255)",
        boxShadow: "0 8px 32px 0 rgba(31, 38, 135, 0.37)",
        backdropFilter: "blur(4px)",

        borderRadius: "20px",
        border: "1px solid whitesmoke ",
        fontFamily: "sans-serif",
      }}>
      <TopSongsHeader header="Top Songs on Mudex" />
      <DropdownsandSearchHeader
        data={data}
        data2={data2}
        selectedOption={selectedOption}
        selectedOptionforTime={selectedOptionforTime}
        setSelectedOption={setSelectedOption}
        setSelectedOptionforTime={setSelectedOptionforTime}
      />
      <Col
        style={{
          backgroundColor: "rgba(5, 24, 57, 255)",
        }}
        lg={12}>
        <Card
          style={{
            backgroundColor: "rgba(5, 24, 57, 255)",
          }}>
          <Card.Body>
            <Table
              style={{
                backgroundColor: "rgba(5, 24, 57, 255)",
                color: "white",
                fontSize: "25px",
                //remove border
                border: "none",
              }}
              responsive
              hover
              className="header-border verticle-middle ">
              <thead>
                <tr>
                  <th scope="col">#</th>
                  <th scope="col">Token Name</th>
                  <th scope="col">Price</th>
                  <th scope="col">Change</th>
                  <th scope="col">TVL</th>
                  <th scope="col">Volume</th>
                </tr>
              </thead>
              <tbody>
                <tr>
                  <th>1</th>
                  <td>Air Conditioner</td>
                  <td>
                    <ProgressBar now={70} variant="primary" />
                  </td>
                  <td>
                    <Badge bg="" className="badge-primary light">
                      70%
                    </Badge>
                  </td>
                </tr>
                <tr>
                  <th>2</th>
                  <td>Textiles</td>
                  <td>
                    <ProgressBar variant="success" now="70" />
                  </td>
                  <td>
                    <Badge bg="success">70%</Badge>
                  </td>
                </tr>
                <tr>
                  <th>3</th>
                  <td>Milk Powder</td>
                  <td>
                    <ProgressBar variant="dark" now="70" />
                  </td>
                  <td>
                    <Badge bg="" className="badge badge-dark light">
                      70%
                    </Badge>
                  </td>
                </tr>
                <tr>
                  <th>4</th>
                  <td>Vehicles</td>
                  <td>
                    <ProgressBar variant="danger" now="70" />
                  </td>
                  <td>
                    <Badge bg="danger">70%</Badge>
                  </td>
                </tr>
                <tr>
                  <th>5</th>
                  <td>Boats</td>
                  <td>
                    <ProgressBar variant="warning" now="70" />
                  </td>
                  <td>
                    <Badge bg="warning">70%</Badge>
                  </td>
